import "./App.scss";
import Home from "./routes/home/home";
import { Routes, Route } from "react-router-dom";

function SomeComponent() {
	return <h1>SomeComponent</h1>;
}

function App() {
	return (
		<Routes>
			<Route path="/" element={<SomeComponent />} />
			<Route path="/" element={<Home />}></Route>
		</Routes>
	);
}

export default App;
